import React from 'react';
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';

class Artista extends React.Component {
  render() {
    const { listAlbuns } = this.props;
    const mapAlbuns = listAlbuns.map(({ artistName,
      collectionId, collectionName, artworkUrl100,
    }) => (
      <Link
        key={ collectionId }
        data-testid={ `link-to-album-${collectionId}` }
        to={ `/album/${collectionId}` }
      >
        <div class="row">
          <div class="col-sm-6">
            <div className="card">
              <img
                className="card-img-top cardAlbum"
                src={ artworkUrl100 }
                alt={ `album do artista ${artistName}` }
              />
              <div className="card-body">
                <h5 className="card-title">{ collectionName }</h5>
                <p>{ artistName }</p>
              </div>
            </div>
            </div>  
        </div>
      </Link>
    ));

    const number = 0;
    return (
      <div className="card">
        { mapAlbuns.length > number ? mapAlbuns : 'Nenhum álbum foi encontrado'}
      </div>
    );
  }
}

Artista.propTypes = {
  listAlbuns: PropTypes.arrayOf(
    PropTypes.object,
  ).isRequired,
};

export default Artista;
